import React from "react";

const Nav = () => {
  return (
    <nav>
      <form>
        <input type="text" placeholder="Search"></input>
      </form>
    </nav>
  );
};

export default Nav;

const styles = {
  container: {
    display: "flex",
    flexDirection: "row",
  },
};
